import React from "react";
import classes from './Home.module.css';
import { Link} from "react-router-dom";
import Home_Img from "../../Images/Home.svg";

function Home() {
    return (
    <div className={classes.Home}>
      <div className={classes.Home_Image}>
        <h1>EMS</h1>
        <img src={Home_Img} alt="Home" />
      </div>
      <div className={classes.Nav_Box}>
              <div className={classes.bottomLinkWrapper}>
              <Link to="/SignIn" className={classes.BottomLinks}>
                SIGN IN
              </Link>
              
              <Link to="/SignUp" className={classes.BottomLinks}>
                SIGN UP
              </Link>
            </div>
        </div>
    </div>
  );
}

export default Home;
